import React from 'react';
import { Link } from 'react-router-dom';
import logo from './pictures/logo.png';
import bgImage from './pictures/bgkape.jpg';

const Header = () => {
  return (
    <section className="relative min-h-screen w-full bg-cover bg-center" style={{ backgroundImage: `url(${bgImage})` }}>
      <nav className="flex justify-between items-center p-4 bg-opacity-50 bg-gray-900">
        <img src={logo} alt="Logo" className="w-24 h-24 rounded-full" />

        <div className="flex-1 text-right">
          <ul className="flex space-x-4">
            <li><Link to="/" className="text-white text-lg hover:bg-white hover:text-black px-3 py-2 rounded">HOME</Link></li>
            <li><Link to="/about-us" className="text-white text-lg hover:bg-white hover:text-black px-3 py-2 rounded">About Us</Link></li>
          </ul>
        </div>
        <i className="fa fa-bars text-white text-2xl cursor-pointer"></i>
      </nav>
      <div className="absolute top-1/3 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-center">
        <h1 className="text-7xl text-yellow-200">WELCOME TO COFFEE TASTING</h1>
      </div>
      <div className="absolute top-2/3 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-center">
        <h2 className="text-2xl italic text-yellow-200">Where every sip is a memory</h2>
      </div>
    </section>
  );
};

export default Header;
